var gApp = angular.module("gTrack", []);


gApp.filter('endL', function () {
    return function (x) {
        return x.join(", ");
    };
});


gApp.controller('gTrackCtrl', function ($scope, $timeout, $interval) {

    ///Variables to control index page
    $scope.index = 1
    $scope.indexRadio = "id"
    $scope.indexData = []


    //IndexFunc generates terms for index page
    $scope.indexFunc = () => {


        db_cursor.skip(($scope.index - 1) * 10).limit(10).exec(function (err, docs) {
            $timeout(() => {
                $scope.indexData = docs
            }, 20)
        })

    }

    $scope.indexJump = (desiredIndex) => {
        try {

            if (isNaN(desiredIndex = parseInt(desiredIndex))) {
                throw "Invalid Expression, Please Enter a Number."
            }

            if (!($scope.index == desiredIndex)) {
                if ((desiredIndex <= $scope.pageCount) && (desiredIndex > 0)) {
                        $scope.index = desiredIndex
                        $scope.indexFunc() 
                } else {
                    throw "Expression should be between 1 and " + $scope.pageCount
                }
            }


        } catch (error) {
            alert(error)

        }

    }

    $scope.indexFunc()

    //To get total pages for index
    render.db.count({}, function (err, count) {
        count = Math.ceil(count / 10)
        $timeout(() => {
            $scope.pageCount = count
        }, 100)
    });

    /* Start Graph Functions */

    //Variables to control graph
    $scope.graphNetwork = {}
    $scope.isGraphComplete = false
    $scope.termToHandle = []
    $scope.graphNodes = []
    $scope.graphEdges = []
    $scope.graphDic = {}
    $scope.currentNode = 2
    $scope.doneNodes = []

    $scope.addEdge = (childNode, parentNode) => {

        $scope.graphEdges.push({
            from: parentNode,
            to: childNode
        })

    }


    $scope.addNode = (nodeId, nodeLabel) => {
        $scope.graphNodes.push({
            id: nodeId,
            label: nodeLabel
        })
    }



    $scope.addParentEdges = (child, parents) => {

        if (parents) {
            var temp
            parents.forEach(function (currentValue) {

                if (!(temp = $scope.graphDic[currentValue])) {
                    temp = $scope.currentNode++;
                    $scope.graphDic[currentValue] = temp
                    $scope.addNode(temp, currentValue)
                }

                $scope.termToHandle.push(currentValue)
                //console.log(temp)
                $scope.addEdge(child, temp)


            })
        }


    }


    $scope.drawGraph = () => {

        if ($scope.graphNetwork.network != null) {

            try {
                $scope.graphNetwork.network.destroy()
            } catch (TypeError) {}

            $scope.graphNetwork.network = null
        }

        var container = document.getElementById('termchart');
        var data = {
            nodes: $scope.graphNodes,
            edges: $scope.graphEdges
        };

        var options = {
            layout: {
                hierarchical: {
                    sortMethod: "directed",
                    nodeSpacing: 140
                }
            },
            edges: {
                smooth:true,
                arrows: {
                    from: true
                }
            },
            interaction: {
                navigationButtons: true,

            },
            physics: {
                enabled: false
            }

        };

        $timeout(function () {
            $scope.graphNetwork.network = new vis.Network(container, data, options);
            $scope.isGraphComplete = true;
        }, 100)



    }

    $scope.stopGraphInterval = () => {

        if (!($scope.termToHandle[0])) {
            $interval.cancel($scope.graphInterval)

            $scope.drawGraph()
            //drawGraph
        }

    }

    $scope.generateGraph = () => {
        var currentTerm

        if ($scope.termToHandle[0]) {

            if ($scope.doneNodes.indexOf(currentTerm = $scope.termToHandle.shift()) < 0) {

                if (currentId = $scope.graphDic[currentTerm]) {

                    $scope.doneNodes.push(currentTerm)
                    render.db.findOne({
                        id: currentTerm
                    }, function (err, doc) {

                        let handleParents = new Promise((resolve, reject) => {
                            setTimeout(() => {

                                try {

                                    resolve(Object.values(doc.relationship).reduce(
                                        function (previousArray, currentArray) {
                                            return previousArray.concat(currentArray);

                                        }))

                                } catch (error) {
                                    reject(
                                        ontologyRoots.indexOf(doc.id) < 0 ? error.message : "Don't Worry It is Ontology Root"
                                    )
                                }

                            }, 60)
                        })

                        handleParents.then((parentArray) => {

                            $scope.addParentEdges(currentId, parentArray)

                        }).catch((reason) => {
                            console.log("Promise Unfulfilled, Reason:" + reason)
                        })



                    })
                }
            }

        } else {
            $timeout($scope.stopGraphInterval, 100)
        }

    }

    /* End Graph Functions */

    //Switching from indexPage to Term Page

    $scope.setTermPage = function () {
        

        try {

            if ($scope.termPage = Boolean($scope.data.id)) {
                

                if ($scope.data.id != $scope.graphNetwork.term) {
                    $scope.graphNetwork.term = $scope.data.id
                    $scope.isGraphComplete = false
                    $('.nav-tabs li:eq(1) a').click()


                    $scope.termToHandle.push($scope.data.id)
                    $scope.addNode(1, $scope.data.id)
                    $scope.graphDic[$scope.data.id] = 1

                    $scope.graphInterval = $interval($scope.generateGraph, 180)


                }

            } else {
                alert(invalidString)
            }

        } catch (error) {
            alert(invalidString)
            $scope.termPage = false
        }


    }

    //Set Data and switch to termpage if data valid
    $scope.setData = function (data) {
        $scope.data = data
        $timeout($scope.setTermPage, 80)
    }

    //Used in index to go to termpage
    $scope.goTermPage = (term) => {
        $scope.setData(term)
    }

    //Used for search box control
    $scope.goToTerm = function (searchBoxEvent) {


        if ((searchBoxEvent.key == "Enter" ||
                searchBoxEvent.type == "click") && $scope.searchTerm) {
            render.db.findOne({
                id: $scope.searchTerm.toUpperCase()
            }, function (err, doc) {
                $scope.setData(doc)
            })


        }

    }

    //Switching from Term Page to indexPage 
    $scope.goHome = function () {
        $scope.termPage = false
        $scope.termToHandle = []
        $scope.graphNodes = []
        $scope.graphEdges = []
        $scope.graphDic = {}
        $scope.currentNode = 2
        $scope.doneNodes = []
    }

    document.getElementById("fullpagem").style.display = "block"
});

